import PropTypes from "prop-types";
import React from "react";

/**
 * 모든 페이지의 공통인 부분을 처리한다.
 */
const App = ({Component}) => {
  return (
    <Component />
  )
}

App.PropTypes = {
  Component: PropTypes.elementType.isRequired
}

export default App;
